import React, { Component } from "react";

class Header extends Component {

    render() {
        const headerStyle = {
            width: '100%',
            background: '#000',
            height: '300px',
            fontSize: '20px'
        }
        return (
            <header style={headerStyle} >Hei {this.props.name}</header>
        );
    }
}

export default Header;
